import React from "react";

export default function Fetch (){

    

    const FetchAPI=()=>{

        fetch('https://jsonplaceholder.typicode.com/todos/')
        .then((res)=> res.json())
        .then((json)=>{ console.log(json)
           
        })
        
        }

    return(

        <>
        <h2>API</h2>

        <button onClick={FetchAPI}>Fetch</button>
        </>
    )
}
